import IncrementCell from "./components/Main/Table/TableBody/TableRow/CellRenderer/IncrementCell";
import PercentageCell from "./components/Main/Table/TableBody/TableRow/CellRenderer/PercentageCell";
import StaticCell from "./components/Main/Table/TableBody/TableRow/CellRenderer/StaticCell";
import SumCell from "./components/Main/Table/TableBody/TableRow/CellRenderer/SumCell";

export const cellRenderers = {
   static: StaticCell,
   sum: SumCell,
   increment: IncrementCell,
   percentage: PercentageCell,
};
